import './Header.css';

{/* Header will go here */}


export default Header;


function Header() {
    return (
        <header className="header">
            {/* <img src="logo.png" alt="Company Logo" className="logo" /> */}
            <nav>
                <ul>
                    <a href="/">Home</a>
                    <a href="/about">About</a>
                    <a href="/services">Services</a>
                    <a href="/contact">Contact</a>
                </ul>
            </nav>
        </header>
    );
}
